import {  //antd引入
    HomeOutlined,
    AppstoreAddOutlined,
    UserOutlined,
    BarChartOutlined,
    SafetyOutlined,
    MailOutlined,
    } from '@ant-design/icons';

const menuList = [
            {
                title: '首页', // 菜单标题名称
                key: '/admin/home', // 对应的 path
                icon: <HomeOutlined />, // 图标名称
            },

            {
                title: '商品',
                key: '/products',
                icon: <AppstoreAddOutlined />,
                children: [ // 子菜单列表
                    {
                    title: '品类管理',
                    key: '/category',
                    icon: 'bars'
                    },
                    {
                    title: '商品管理',
                    key: '/product',
                    icon: 'tool'
                    },
                ]
            },
                {
                    title: '用户管理',
                    key: '/admin/user',
                    icon: <UserOutlined />,
                },
                {
                    title: '角色管理',
                    key: '/admin/role',
                    icon: <SafetyOutlined />,
                },
            {
                title: '图形图表',
                key: '/charts',
                icon: <BarChartOutlined />,
                children: [
                    {
                        title: '柱形图',
                        key: '/admin/bar',
                        icon: 'bar-chart'
                    },
                    {
                        title: '折线图',
                        key: '/admin/line',
                        icon: 'line-chart'
                    },
                    {
                        title: '饼图',
                        key: '/admin/pie',
                        icon: 'pie-chart'
                    },
                ]
            },
        ]
    export default menuList
